import React from 'react';
import moment from 'moment';
import './calendar.css';
const Calendar = () =>{
  let weekdayshort = moment.weekdayShort();
  let weekdayshortname = this.weekdayshort.map(day => {
      return (
          <th key = {day} className = "week-day">
              {day}
          </th>
      );
  });
};

 export default Calendar;
